import React from 'react';

export default function RightSidebar({ models, onSelectModel }) {
  return (
    <div>
      <h3>All Models</h3>
      {models.map((model) => (
        <div
          key={model.id}
          onClick={() => onSelectModel(model)}
          style={{ cursor: 'pointer', marginBottom: '0.5rem' }}
        >
          {model.name}
        </div>
      ))}
    </div>
  );
}
